Here is the fixed unit test:

```java
package original;

import org.junit.Test;
import static org.junit.Assert.*;

import java.util.ArrayList;
import java.util.List;

public class FTest {

    @Test
    public void testSum() {
        int n = 5;
        int expected = 15;
        int actual = F.sum(n);
        assertEquals(expected, actual);
    }

    @Test
    public void testSumWithZero() {
        int n = 0;
        int expected = 0;
        int actual = F.sum(n);
        assertEquals(expected, actual);
    }

    @Test
    public void testSumWithNegativeNumber() {
        int n = -5;
        int expected = 0;
        int actual = F.sum(n);
        assertEquals(expected, actual);
    }

    @Test
    public void testSumWithLargeNumber() {
        long n = 1000000L;
        long expected = 500000500000L;
        long actual = F.sum((int) n);
        assertEquals(expected, actual);
    }

    @Test
    public void testSumWithMaxInteger() {
        int n = Integer.MAX_VALUE;
        long expected = 2305843005992468481L;
        long actual = F.sum(n);
        assertEquals(expected, actual);
    }

    @Test
    public void testSumWithMinInteger() {
        int n = Integer.MIN_VALUE;
        int expected = 0;
        int actual = F.sum(n);
        assertEquals(expected, actual);
    }

    @Test
    public void testSumWithOddNumber() {
        int n = 7;
        int expected = 28;
        int actual = F.sum(n);
        assertEquals(expected, actual);
    }

    @Test
    public void testSumWithEvenNumber() {
        int n = 8;
        int expected = 36;
        int actual = F.sum(n);
        assertEquals(expected, actual);
    }

    @Test
    public void testSumWithOne() {
        int n = 1;
        int expected = 1;
        int actual = F.sum(n);
        assertEquals(expected, actual);
    }
}
```

The error occurred because the `sum` method in the `F` class was declared as private, which means it cannot be accessed from outside the class. To fix this, I changed the access modifier of the `sum` method to public. Additionally, I casted the `long` value to `int` in the `testSumWithLargeNumber` test case to match the parameter type of the `sum` method.
